import React, { Component } from 'react';

class ReadData extends Component {
    static defaultProps = {
        data: {
            name: 'kangmun',
            hospital: 'mokpo',
            data: 'cold',
        }
    }

    render() {
        const {
            name, hospital, data
        } = this.props.data;

        return (
            <div>
                <div><b>{name}</b></div>
                <div><b>{hospital}</b></div>
                <div><b>{data}</b></div>
            </div>
        )
    }
}

export default ReadData;
